import React from 'react';
import './Footer.css';


export default function Footer() {
  return (
    <div className='container'>
      <div className='box'>Merinoo</div>
      <div className='box'>
        <h1>La constante de Proponer</h1>
      </div>
      <div className='box'>
      <img src='salonPlasticaMexicana-9fdd5cff.png' width='80px' height='80px'></img>
        Miembro Activo del Salón de la Plástica Mexicana 
      </div>
    </div>
  );
}
